import React from 'react';
import './App.css';
// import ArrayTable from './ArrayTable';
 import TableRow from './TableRow';



function App() {

  return (
    <div className="">
      <table>
      this.employees.map((employee) =>
        <TableRow id={employee.id} name={employee.name}></TableRow>
      })
      </table>
     </div>
  )
}

export default App;
